package org.mingtaoz.leetcode.recursion;

import static org.truth0.Truth.ASSERT;

import org.junit.Test;
import org.junit.Before;
import org.mingtaoz.leetcode.recursion.Matching;

public class MatchingTest {

    private Matching sut;

    @Before
    public void setup() {
        sut = new Matching();
    }

    @Test
    public void testRegularMatching12() {
        ASSERT.that(sut.isMatch("aaa", "ab*a*c*a")).isTrue();
    }

    @Test
    public void testRegularMatching11() {
        ASSERT.that(sut.isMatch("aa", ".")).isFalse();
    }

    @Test
    public void testRegularMatching10() {
        ASSERT.that(sut.isMatch("aa", "a")).isFalse();
    }

    @Test
    public void testRegularMatching9() {
        ASSERT.that(sut.isMatch("", ".")).isFalse();
    }

    @Test
    public void testRegularMatching8() {
        ASSERT.that(sut.isMatch("", "")).isTrue();
    }

    @Test
    public void testRegularMatching7() {
        ASSERT.that(sut.isMatch("", ".*")).isTrue();
    }

    @Test
    public void testRegularMatching6() {
        ASSERT.that(sut.isMatch("abcabcd", ".*abcabcd")).isTrue();
    }

    @Test
    public void testRegularMatching5() {
        ASSERT.that(sut.isMatch("aab", ".bb")).isFalse();
    }

    @Test
    public void testRegularMatching4() {
        ASSERT.that(sut.isMatch("aab", ".*bb")).isFalse();
    }

    @Test
    public void testRegularMatching3() {
        ASSERT.that(sut.isMatch("ab", "aa.*")).isFalse();
    }

    @Test
    public void testRegularMatching2() {
        ASSERT.that(sut.isMatch("ab", ".*")).isTrue();
    }

    @Test
    public void testRegularMatching1() {
        ASSERT.that(sut.isMatch("aab", "c*a*b")).isTrue();
    }

    @Test
    public void testWildcardMatching8() {
        ASSERT.that(sut.isMatchWildCard("hi", "*?")).isTrue();
    }

    @Test
    public void testWildcardMatching7() {
        ASSERT.that(sut.isMatchWildCard("aa", "*")).isTrue();
    }

    @Test
    public void testWildcardMatching6() {
        ASSERT.that(sut.isMatchWildCard("b", "*?*?*")).isFalse();
    }

    @Test
    public void testWildcardMatching5() {
        ASSERT.that(
                sut.isMatchWildCard(
                        "bbbbbabababbbabbbbaaabbbbabbaabbaabbaabaaabaaababbabababaaaaabaabbbabaaabbababbbaababbbbbbaaaaabbabaababbabbbaababbabababbabbbbababbabbbaaabaabbaabbbabaaaabbbaabbbbaaaaaaabbbabbbaabbbbbbbaababaabaabbb",
                        "***ba**bbaaa*b***bba*abaa*aaa****b***baababab***ab**ba*b**b**bba*a**b******a******aa**bbb*a**b**b*a*b"))
                .isFalse();
    }

    @Test
    public void testWildcardMatching4() {
        ASSERT.that(sut.isMatchWildCard("c", "*?*")).isTrue();
    }

    @Test
    public void testWildcardMatching3() {
        ASSERT.that(sut.isMatchWildCard("aa", "a")).isFalse();
    }

    @Test
    public void testWildcardMatching2() {
        ASSERT.that(
                sut.isMatchWildCard(
                        "",
                        "**"))
                .isFalse();
    }

    @Test
    public void testWildcardMatching1() {
        ASSERT.that(
                sut.isMatchWildCard(
                        "bbbababbbbabbbbababbaaabbaababbbaabbbaaaabbbaaaabb",
                        "*b********bb*b*bbbbb*ba")).isFalse();
    }
}
